import React from 'react';
import PerformanceTableItem from './PerformanceTableItem';

function PerformanceTableBody(props) {
  return (
    <div className='performanceTableBody'>
      {props.data && props.data.length
        ? props.data.map(item => (
            <div className='performanceTableBody__row'>
              <PerformanceTableItem
                name={'name'}
                className='performanceTableItem__name'
              />
              <PerformanceTableItem name={'name'} />
            </div>
          ))
        : 'No Data Found'}
    </div>
  );
}

export default PerformanceTableBody;
